import headerImage from '../assets/headerImage.jpg';

export const PageHeader = ({screenWidth}) => {

    return (
        <header>
            <div id="intro">
				<h1>Introducing: Alistair Sinclair-Smith</h1>
				<p>A convert from SEO to Full Stack Development.</p>
			</div>
            {screenWidth <= 645 && (
                <div id="top-img">
                    <img src={headerImage} alt="Alistair Sinclair-Smith hanging out at a friend's flat" />
                </div>
            )}
        </header>
    )
}
